description:
Amazing Ocean (Los Banditos)

Nature Documentary hosted by Glen McGready, published by Los Banditos in 2013 - English narration


Information
------------------------------

Amazing Oceans is a fantastic journey through the magic of the deep blue sea. Let yourself be amazed by little schools of fish that swim right into your living room and experience dolphins and whale sharks that visit you on your sofa. Amazing Oceans is a breathtakingly beautiful experience for the whole family. Fun for the young and the young at heart!
Also known as &quot;Fantastische Ozeane&quot;.
This is just the 2D version.

